webpackJsonp([0x69d6b69bcb79],{785:function(a,n){a.exports={data:{markdownRemark:{frontmatter:{title:"CHERNOKNIZHNICA",type:"lyrics"},html:"<h1>CHERNOKNIZHNICA</h1>\n<section>\n<p>Nichego ne pishetsja — <br>\nstal ja vyshe mesjaca.<br>\nJeto chernoknizhnica,<br>\nserp skovav iz mesjaca,<br>\nsrezala mne volosy — <br>\nsdelala obmanutym.<br>\nZagremel ja sovest'ju,<br>\nsprjatannoj karmanami.<br>\nJa na stol ih vyvernul — <br>\ntam igra da zoloto<br>\nstavjat pered vyborom,<br>\nzagibajut vorotom.<br>\nVes' ja peremeshannyj<br>\ns pamjat'ju o budushhem<br>\nprevrashhajus' v peshego<br>\nv chelovech'e chudishhe.</p>\n<p>Oj da oj!<br>\nJel' da laj!<br>\nPoj da poj,<br>\nda igraj!<br>\nDoigraj do zapetyh<br>\ndo oborvannyh not — <br>\ni ty srezhesh' sekret<br>\njetih ruk, budto plod<br>\nOj da oj!<br>\nLaj da laj!<br>\nPoj da poj,<br>\nda igraj.<br>\nDoigraj do konca,<br>\ni togda ja vojdu.<br>\nU nachala kol'ca<br>\nryba b'jotsja vo l'du.</p>\n<p>Oj ty, chernoknizhnica,<br>\ngde chereshnja lopnula,<br>\ntam nichto ne dvizhetsja — <br>\npustota da stjokla tam.<br>\nNi vo chto ne veritsja.<br>\nNichego ne kruzhitsja.<br>\nBelyj mesjac penitsja,<br>\nzvjozdy budto kruzheva.<br>\nNoch' morgaet s berega.<br>\nSlyshish', chernoknizhnica!<br>\nTy menja ne sberegla<br>\nSlyshish', slyshish' — pishetsja!<br>\nSlyshish', rasstupaetsja!<br>\nPesnja raspojasalas'!<br>\nRyba bultyhaetsja,<br>\ntol'ko bajut jasli nas.</p>\n<p>Jel' da ljej!<br>\nLaj da lal!<br>\nPel da pel,<br>\nda igral.<br>\nDoigral do zapetyh<br>\ndo oborvannyh not — <br>\ni ty srezal sekret<br>\njetih ruk, budto plod.<br>\nOj da oj!<br>\nLaj da laj!<br>\nPoj da poj,<br>\nda igraj!<br>\nDoigraj do konca,<br>\ni togda my vojdjom — <br>\nu nachala kol'ca<br>\nbudem ryboj vdvojom.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/chernoknizhnica/"}}}});
